    - For each row and column, we check all 8 adjacent square (top, left, right, bottom) if they are bomb, we increment the square's bomb counter.
    - We then increment the number of bomb squares at the current row and column.
    - We increment the number of bomb squares at the current row and column in the next row and column.
    - We repeat this process until the grid is filled.
    - We then print the grid in rows.

    Time Complexity: O(N) where N is the number of strings in stdin.
    Space Complexity: O(N) where N is the number of strings in stdin.
