            elif c == '#':
                grid[i][j] = 1

    def bomb_count(x: int, y: int, grid: List[List[int]]) -> int:
        return sum(grid[i][y] for i in range(x-1, x+2) for j in range(y-1, y+2) if (0 <= i < h and 0 <= j < w) and grid[i][j] == 1)

    def increment(x: int, y: int, grid: List[List[int]]) -> None:
        for i in range(x-1, x+2):
            for j in range(y-1, y+2):
                if (0 <= i < h and 0 <= j < w):
