def solution(stdin: str) -> str:
    """Returns the K-th lexicographically smallest substring of s when we know the size of s"""
    n = int(stdin)
    s = stdin[:n]
    k = int(stdin[n:])

    if k <= 0:
        return ""
    if k == 1:
        return s

    def get_lexicographically_smallest(s: str) -> str:
        """Returns the K-th lexicographically smallest substring of s when we know the size of s"""
        n = len(s)
        if n == k:
            return s
        for i in range(1, n - k + 2):
            if s[i:i + k] < s[i - 1:i - 1 + k]:
                return s[i - 1:i - 1 + k]
        return s[n - k:n]

    def is_substring(s: str, substring: str) -> bool:
        """Returns True if substring is a substring of s"""
        n = len(s)
        m = len(substring)
        for i in range(0, n - m + 1):
            if s[i:i + m] == substring:
                return True
        return False

    for _ in range(k - 1):
        s = get_lexicographically_smallest(s)
        if is_substring(s, s):
            return s
    return s


