def solution(stdin: str) -> str:
    from collections import defaultdict
    from functools import lru_cache
    data = stdin.strip().split('\n')
    capacity, n = int(data[0].split(' ')[0]), int(data[0].split(' ')[1])
    previous_train_visits = defaultdict(int)
    prev_stop_visits = defaultdict(int)
    current_train_visits = defaultdict(int)
    current_stop_visits = defaultdict(int)

    def count_people_entered(capacity, current_train_visits, current_stop_visits):
        return sum(current_train_visits[i] for i in current_train_visits)

    def count_people_left(capacity, current_train_visits, current_stop_visits):
        return sum(current_train_visits[i] for i in current_train_visits) - sum(current_stop_visits[i] for i in current_stop_visits)

    @lru_cache(maxsize=None)
    def recurse(capacity, train_visits, stop_visits, train_index):
        if train_index == n:
            return count_people_entered(capacity, train_visits, stop_visits) == 0 and count_people_left(capacity, train_visits, stop_visits) == 0
        if train_visits[train_index] == 0:
            current_train_visits[train_index] = 1
            if recurse(capacity, train_visits, stop_visits, train_index + 1):
                return True
            current_train_visits[train_index] = 0
            return False
        if stop_visits[train_index] == 0:
            current_stop_visits[train_index] = 1
            if recurse(capacity, train_visits, stop_visits, train_index + 1):
                return True
            current_stop_visits[train_index] = 0
            return False
        return False

    recurse(capacity, previous_train_visits, prev_stop_visits, 1)
    return 'impossible' if prev_stop_visits else 'possible'

