        s.append(stdin.readline().strip())
    edges = []
    for i in range(n):
        for j in range(i + 1, n):
            m = 0
            for a, b in zip(s[i], s[j]):
                if a!= b:
                    m += 1
            edges.append([i, j, m])
    edges.sort(key=lambda x: x[2])
    # print(edges)
    edges_ = {}
    for i in range(len(edges)):
        if edges[i][2] > edges[i - 1][2]:
            edges[i][2] = edges[i - 1][2]
        if edges[i][2] in edges_:
            edges_[edges[i][2]].append([edges[i][0], edges[i][1]])
        else:
            edges_[edges[i][2]] = [[edges[i][0], edges[i][1]]]
    # print(edges_)
    tree = []
    for w in edges_:
        t = [w]
        q = edges_[w]
        while len(q) > 1:
            t.append(q.pop())
        tree.append(t)
    tree.sort(key=lambda x: x[0])
    # print(tree)
    ret = ''
    for t in tree:
        for e in t:
            ret += str(e[0]) +'' + str(e[1]) + '\n'
    return ret[:-1]

