    W = int(stdin.strip().split("\n")[0].split(" ")[2])

    def wA(i):
        if i == 0:
            return 0
        return A[i - 1]

    def wB(i):
        if i == 0:
            return 0
        return A[i - 1]

    def lost(i, j):
        if i == 0:
            return 0
        if j == 0:
            return 0
        return max(wA(i - 1), wB(j - 1))

    def excess(i, j):
        return min(wA(i), wB(j)) - max(wA(i - 1), wB(j - 1))

    g = 0
    for i in range(1, V + 1):
        for j in range(1, W + 1):
            g += excess(i, j)

    g /= V

    return "A %d %d" % (wA(V), wB(W)) + "\n" + "A %d %d" % (excess(V, W), lost(V, W)) + "\n" + "%.8f" % g

