        if x < 0 or x >= r or y < 0 or y >= c:
            return

        if d[x][y] == 1:
            visited[x][y] = True
            solve(x - 1, y, visited)
            solve(x + 1, y, visited)
            solve(x, y - 1, visited)
            solve(x, y + 1, visited)

    visited = [
        [
            False
            for _ in range(c)
        ]
        for _ in range(r)
    ]

    count = 0

    for i in range(r):
        for j in range(c):
            if not visited[i][j]:
                solve(i, j, visited)
                count += 1

    return count


